import React, { useState } from "react";
import { Stage, Image, Group } from "react-konva";
import Ruller from '../../../assets/Icons/ruler.svg'

const RulerComponent = () => {
    const [image, setImage] = useState('');
    const [imageX, setImageX] = useState(0);
    const [imageY, setImageY] = useState(0);
    const [imageRotation, setImageRotation] = useState(0);
    const [imageScaleX, setImageScaleX] = useState(1);
    const [imageScaleY, setImageScaleY] = useState(1);

    const handleImageLoad = (e) => {
        setImage(e.target);
    };

    const handleDragEnd = (e) => {
        setImageX(e.target.x());
        setImageY(e.target.y());
    };

    const handleTransformEnd = (e) => {
        const transform = e.target.getTransform();
        setImageRotation(transform.rotation);
        setImageScaleX(transform.scaleX);
        setImageScaleY(transform.scaleY);
    };

    return (
        <Stage height={600} width={600}>
            <Group
                x={imageX}
                y={imageY}
                rotation={imageRotation}
                onDragEnd={handleDragEnd}
                onTransformEnd={handleTransformEnd}
                draggable
            >
                <Image
                    image={image}
                    onLoad={handleImageLoad}
                    scaleX={imageScaleX}
                    scaleY={imageScaleY}
                />
            </Group>
        </Stage>
    );
}

export default RulerComponent